import Vue from 'vue'
import VueRouter from 'vue-router'
import Graph from '../views/Graph.vue'

Vue.use(VueRouter)

const routes = [{
    path: '/',
    name: 'graph',
    component: Graph
  }
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
